import { Typography, Grid } from '@material-ui/core';
import React from 'react';

export const ShopCollection = ({ title, items }) => {
  return (
    <>
      <Typography variant='h4' gutterBottom>
        {title}
      </Typography>
      <Grid container>
        {items.map((item) => (
          <Grid item xs={12} sm={3}>
            {item.name}
          </Grid>
        ))}
      </Grid>
    </>
  );
};
